// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IBotInstance {
    struct BotConfig {
        address quoteAsset;
        uint256 defaultAmount;
        uint256 stopLossPercent; //percent in basis point. %5 == 500.
        bool loop; //if loop is true this instance will remain active after position is closed and wait for another signal.
        bool defaultAmountOnly;
    }

    struct Position {
        //change address to code with mapping
        address baseAsset;
        // uses single storage slot
        uint112 openReserveA;
        uint112 openReserveB;
        uint32 blockTimestamp;
        //can add fields up to 256bit
        uint112 amount;
        uint16 sells;
        uint16 buys;
        bool open;
    }

    enum Side {
        Buy,
        Sell,
        Withdraw
    }

    event TradeComplete_(
        Side side,
        address token0,
        address token1,
        uint256 amount0,
        uint256 amount1,
        uint256 indexed pTime,
        uint256 tTime
    );

    function getPosition() external view returns (Position memory);

    function getPositionAndAmountOut()
        external
        view
        returns (
            Position memory _position,
            uint256 _reserveA,
            uint256 _reserveB
        );

    function getConfig() external view returns (BotConfig memory);
}
